import '../../apiKey'

export default function VideoPlayer({data}){
	return(
			<article className='video'>
				<video className='video__player' controls poster={data.image} id={data.id}>
					<source src={data.video + '/' + apiKey} type={video/webm} />
				</video>
			</article>

	);
}
